module Translate.FQC.Matrix where

import Prelude hiding ( (<>) )
import Translate.FQC.Unitary
import Numeric.LinearAlgebra ( (><), (<>) )
import qualified Numeric.LinearAlgebra as L
import Control.Lens ( (.~), element )
import Control.Monad ( guard )
import Data.Function ( on )
import Data.Maybe (fromJust)

type Matrix = L.Matrix L.C

instance {-# OVERLAPS #-} Show Matrix where
    show = L.dispcf 3

-- Check Error monad over whole Translate
matrix :: Unitary -> Maybe Matrix
matrix (Par  xs) = foldl L.kronecker (L.ident 1) <$> mapM matrix xs
matrix (Ser  xs) = foldl (<>) (L.ident 2) <$> mapM matrix xs
matrix (Perm ps) = return $ (dim><dim) $ concatMap (($ replicate dim 0) . (.~ 1) . element) ps
    where dim = length ps
matrix (Cond t c) = (guard =<< (==) <$> arity t <*> arity c) >> (<>) <$> matrix t <*> matrix c
matrix (Rot (i,j) (k,l)) = return $ (2><2) $ map complex [i,j,k,l]

test :: L.Matrix L.C
test = L.kronecker ((fromJust . matrix) mat1) $ L.kronecker ((fromJust . matrix) mat2) ((fromJust . matrix) mat3)

par :: Unitary -> Maybe Matrix
par (Par xs) = foldl L.kronecker (L.ident 1) <$> mapM matrix xs

matPair1 :: (Unitary, Unitary, Unitary)
matPair1 = head matPairs

parMats :: Unitary
parMats = Par [mat1, mat2, mat3]

fstM :: (Unitary, Unitary, Unitary) -> Unitary
fstM (a,b,c) = a

sndM :: (Unitary, Unitary, Unitary) -> Unitary
sndM (a,b,c) = b

trdM :: (Unitary, Unitary, Unitary) -> Unitary
trdM (a,b,c) = c

mat1 :: Unitary
mat1 = fstM $ head matPairs
mat2 :: Unitary
mat2 = sndM $ head matPairs
mat3 :: Unitary
mat3 = trdM $ head matPairs

parRes :: Matrix
parRes = fromJust $ matrix $ Par [mat1, mat2, mat3]

